None\n        toc1 = time.perf_counter()\n        perf[g//timeStep][3] = toc1 - tic1  \n        toc3 = time.perf_counter()\n        perf[g//timeStep][0] = toc3 - tic3\n\n\n\nprint(\"pca, \", pca, flush=True)\nResults.append([pca.explained_variance_ , pca.singular_values_])\ntp = time.perf_counter()\nprint(\"Total time to Dask solution is \", tp-t)\n\npperf = pd.DataFrame(perf,columns=['generation', 'getdata', 'getdataq', 'computation'])\npdata = pd.DataFrame(Results,columns=[ 'his', 'bins'])\n\nwith open(\"perf.csv\", \"a\") as fperf:\n    pperf.to_csv(fperf, encoding='utf-8', index=False)\n    \nwith open(\"diag.csv\", \"a\") as fdiag:\n    pdata.to_csv(fdiag, encoding='utf-8', index=False)\n    \nC.Finalization()\n    \n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1383","type":"BasicTicker"},{"attributes":{},"id":"1422","type":"DatetimeTickFormatter"},{"attributes":{"tools":[{"id":"1386"},{"id":"1387"},{"id":"1388"}]},"id":"1389","type":"Toolbar"},{"attributes":{"axis":{"id":"1016"},"coordinates":null,"dimension":1,"group":null,"ticker":null,"visible":false},"id":"1019","type":"Grid"},{"attributes":{},"id":"1167","type":"CategoricalTicker"},{"attributes":{"coordinates":null,"data_source":{"id":"1038"},"glyph":{"id":"1067"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1069"},"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1071"}},"id":"1070","type":"GlyphRenderer"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"source":{"id":"1038"}},"id":"1071","type":"CDSView"},{"attributes":{"coordinates":null,"group":null,"text":"Memory"},"id":"1250","type":"Title"},{"attributes":{"dimensions":"width"},"id":"1388","type":"WheelZoomTool"},{"attributes":{"axis":{"id":"1163"},"coordinates":null,"group":null,"ticker":null},"id":"1165","type":"Grid"},{"attributes":{},"id":"1141","type":"ResetTool"},{"attributes":{},"id":"1023","type":"ResetT
